import React from 'react';
import classes from './TaskBar.module.css';

const TaskBar = () => {

  return (
    <div>
        <button>Home</button>
        <button>About</button>
        <button>Experience</button>
        <button>Projects</button>
        <button>Contact</button>
        <button>Resume</button>
    </div>
  );
};

export default TaskBar;
